class Solution {
public:
    int findMinimumOperations(string s1, string s2, string s3) {
        // The goal is to find the common prefix that can be formed by removing characters from the end.
        // If no common prefix exists, return -1. Otherwise, return the total number of deletions needed.

        // Find the shortest string length; this will be the maximum possible length of the common prefix.
        int minLength = min(s1.length(), min(s2.length(), s3.length()));

        // Reduce all strings to their shortest possible length that could be a common prefix.
        while (!s1.empty() && s1.length() > minLength) {
            s1.pop_back();
        }
        while (!s2.empty() && s2.length() > minLength) {
            s2.pop_back();
        }
        while (!s3.empty() && s3.length() > minLength) {
            s3.pop_back();
        }

        // Check for equality from the end until the strings are of equal length.
        while (minLength > 0) {
            if (s1 == s2 && s2 == s3) {
                break; // Found the common prefix
            }

            // If not equal, reduce minLength and try again by removing the last character from the strings as needed.
            if (!s1.empty() && s1.length() == minLength) {
                s1.pop_back();
            }
            if (!s2.empty() && s2.length() == minLength) {
                s2.pop_back();
            }
            if (!s3.empty() && s3.length() == minLength) {
                s3.pop_back();
            }
            minLength--;
        }

        if (minLength == 0 && (s1 != s2 || s2 != s3)) {
            // If minLength is reduced to 0 and strings are still not equal, it's impossible to make them equal.
            return -1;
        }

        // Calculate the total number of deletions performed.
        int totalOperations = (s1.length() + s2.length() + s3.length()) - (3 * minLength);
        return totalOperations;
    }
};
